import React from 'react';
import { useParams, Link } from 'react-router-dom';
import styled from 'styled-components';
import { useListings } from '../context/ListingsContext';

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 6rem 2rem 2rem;
`;

const PropertyHeader = styled.div`
  display: grid;
  grid-template-columns: 2fr 1fr;
  gap: 2rem;
  margin-bottom: 2rem;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const ImageGallery = styled.div`
  display: grid;
  grid-template-columns: 2fr 1fr;
  gap: 1rem;
  height: 400px;
`;

const MainImage = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
  border-radius: 12px;
`;

const ThumbnailGrid = styled.div`
  display: grid;
  grid-template-rows: repeat(2, 1fr);
  gap: 1rem;
`;

const Thumbnail = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
  border-radius: 8px;
`;

const PropertyInfo = styled.div`
  background: white;
  padding: 2rem;
  border-radius: 12px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  height: fit-content;
`;

const Price = styled.div`
  font-size: 2.5rem;
  font-weight: 700;
  color: #3b82f6;
  margin-bottom: 1rem;
`;

const Title = styled.h1`
  font-size: 1.8rem;
  font-weight: 600;
  margin-bottom: 0.5rem;
  color: #1e293b;
`;

const Location = styled.p`
  color: #64748b;
  font-size: 1.1rem;
  margin-bottom: 2rem;
`;

const FeaturesList = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 1rem;
  margin-bottom: 2rem;
`;

const Feature = styled.div`
  display: flex;
  align-items: center;
  gap: 0.5rem;
  font-weight: 500;
  color: #374151;
`;

const ContactButton = styled.button`
  width: 100%;
  background: #3b82f6;
  color: white;
  border: none;
  padding: 1rem;
  border-radius: 8px;
  font-size: 1.1rem;
  font-weight: 600;
  cursor: pointer;
  margin-bottom: 1rem;
  transition: background-color 0.2s;

  &:hover {
    background: #2563eb;
  }
`;

const Description = styled.div`
  background: white;
  padding: 2rem;
  border-radius: 12px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  margin-top: 2rem;

  h2 {
    margin-bottom: 1rem;
    color: #1e293b;
  }

  p {
    line-height: 1.7;
    color: #374151;
  }
`;

// Sample property data - in a real app, this would come from an API
const propertyData = {
  1: {
    id: 1,
    title: "Modern Downtown Condo",
    location: "Downtown, Seattle, WA",
    price: 750000,
    type: "sale",
    bedrooms: 2,
    bathrooms: 2,
    sqft: 1200,
    yearBuilt: 2018,
    parking: 1,
    images: [
      "https://images.unsplash.com/photo-1545324418-cc1a3fa10c00?w=800",
      "https://images.unsplash.com/photo-1586023492125-27b2c045efd7?w=400",
      "https://images.unsplash.com/photo-1560448204-e02f11c3d0e2?w=400"
    ],
    description: "This stunning modern condo offers the perfect blend of luxury and convenience in the heart of downtown Seattle. Featuring floor-to-ceiling windows with breathtaking city views, high-end finishes throughout, and an open-concept layout perfect for entertaining. The gourmet kitchen boasts stainless steel appliances, quartz countertops, and custom cabinetry. Both bedrooms are generously sized with ample closet space, and the master suite includes a spa-like ensuite bathroom. Building amenities include a fitness center, rooftop terrace, and concierge services."
  }
};

const PropertyDetail = () => {
  const { id } = useParams();
  const property = propertyData[id];

  if (!property) {
    return (
      <Container>
        <div style={{ textAlign: 'center', padding: '4rem 2rem' }}>
          <h1>Property Not Found</h1>
          <p>The property you're looking for doesn't exist.</p>
          <Link to="/listings" className="btn btn-primary" style={{ marginTop: '2rem' }}>
            Back to Listings
          </Link>
        </div>
      </Container>
    );
  }

  return (
    <Container>
      <Link to="/listings" style={{ 
        color: '#3b82f6', 
        textDecoration: 'none', 
        marginBottom: '2rem', 
        display: 'inline-block',
        fontWeight: '500'
      }}>
        ‚Üê Back to Listings
      </Link>

      <PropertyHeader>
        <ImageGallery>
          <MainImage 
            src={property.images[0]} 
            alt={property.title}
            onError={(e) => {
              e.target.src = 'https://via.placeholder.com/800x400?text=Property+Image';
            }}
          />
          <ThumbnailGrid>
            <Thumbnail 
              src={property.images[1]} 
              alt={property.title}
              onError={(e) => {
                e.target.src = 'https://via.placeholder.com/400x200?text=Image+2';
              }}
            />
            <Thumbnail 
              src={property.images[2]} 
              alt={property.title}
              onError={(e) => {
                e.target.src = 'https://via.placeholder.com/400x200?text=Image+3';
              }}
            />
          </ThumbnailGrid>
        </ImageGallery>

        <PropertyInfo>
          <Price>
            ${property.price.toLocaleString()}
            {property.type === 'rent' && <span style={{ fontSize: '1rem', color: '#64748b' }}>/month</span>}
          </Price>
          <Title>{property.title}</Title>
          <Location>üìç {property.location}</Location>

          <FeaturesList>
            <Feature>üõèÔ∏è {property.bedrooms} Bedrooms</Feature>
            <Feature>üöø {property.bathrooms} Bathrooms</Feature>
            <Feature>üìê {property.sqft.toLocaleString()} sqft</Feature>
            <Feature>üèóÔ∏è Built in {property.yearBuilt}</Feature>
            <Feature>üöó {property.parking} Parking Space</Feature>
            <Feature>üè∑Ô∏è For {property.type === 'sale' ? 'Sale' : 'Rent'}</Feature>
          </FeaturesList>

          <ContactButton>
            Contact Agent
          </ContactButton>

          <ContactButton style={{ background: '#10b981' }}>
            Schedule Tour
          </ContactButton>
        </PropertyInfo>
      </PropertyHeader>

      <Description>
        <h2>About This Property</h2>
        <p>{property.description}</p>
      </Description>
    </Container>
  );
};

export default PropertyDetail;
